import React, {useState} from 'react';
import {View, Text, TextInput, StyleSheet} from 'react';

const App = () => {
  const [myText, setMyText] = useState('Meu texto');

  return (
    <View style={styles.container}>
      <Text>ENTRADA:</Text>
      <TextInput
        value={myText}
        onChangeText={text => {
          setMyText(text);
        }}
      />
      <Text>SAÍDA:</Text>
      <Text>{myText}</Text>
    </View>
  );
};


export default App;
